import React from 'react';

const Car=(num)=> {
    return <h2>Hi, I have {num} Car!</h2>;
  }

const TableHeader = () => {
    return (
      <thead>
        <tr>
          <th>Name</th>
          <th>Job</th>
        </tr>
      </thead>
    )
  }

  const TableBody = () => {
    return (
      <tbody>
        <tr>
          <td>Charlie</td>
          <td>Janitor</td>
        </tr>
        <tr>
          <td>Mac</td>
          <td>Bouncer</td>
        </tr>
        <tr>
          <td>Dee</td>
          <td>Aspiring actress</td>
        </tr>
        <tr>
          <td>Dennis</td>
          <td>Bartender</td>
        </tr>
      </tbody>
    )
  }

  class Table extends React.Component {
    render() {
      return (
        <table>
          <TableHeader />
          <TableBody />

        </table>
      )
    }
  }

  export default Table;
